import React from 'react';

function Courses(props) {
   const { card } = props
   return (
      <div>
         <a href="#" className="course" role="link">
            <div className="course_img" src={card.link}></div>
            <div className="course_title">{card.title}</div>
            <div className="start-date">{card.date}</div>
         </a>
      </div>
   )
}

export default Courses;
